  gimp_va8_t *va8A;
  gimp_va8_t *va8B;
  gimp_va8_t *va8M;
  gimp_va8_t *va8D1;
  gimp_va8_t *va8D2;
  int i;

  rgba8A =  gimp_composite_regression_fixed_rgba8(n_pixels+1);
  rgba8B =  gimp_composite_regression_fixed_rgba8(n_pixels+1);
  rgba8M =  gimp_composite_regression_fixed_rgba8(n_pixels+1);
  rgba8D1 = (gimp_rgba8_t *) calloc(sizeof(gimp_rgba8_t), n_pixels+1);
  rgba8D2 = (gimp_rgba8_t *) calloc(sizeof(gimp_rgba8_t), n_pixels+1);
  va8A =    (gimp_va8_t *)   calloc(sizeof(gimp_va8_t), n_pixels+1);
  va8B =    (gimp_va8_t *)   calloc(sizeof(gimp_va8_t), n_pixels+1);
  va8M =    (gimp_va8_t *)   calloc(sizeof(gimp_va8_t), n_pixels+1);
  va8D1 =   (gimp_va8_t *)   calloc(sizeof(gimp_va8_t), n_pixels+1);
  va8D2 =   (gimp_va8_t *)   calloc(sizeof(gimp_va8_t), n_pixels+1);

  for (i = 0; i < n_pixels; i++) {
    va8A[i].v = i;
    va8A[i].a = 255-i;
    va8B[i].v = i;
    va8B[i].a = i;
    va8M[i].v = i;
    va8M[i].a = i;
  }


  /* gimp_composite_normal_v8_v8_v8 */
  memset ((void *) &special_ctx, 0, sizeof(special_ctx));
  special_ctx.op = GIMP_COMPOSITE_NORMAL;
  special_ctx.n_pixels = n_pixels;
  special_ctx.scale.scale = 2;
  special_ctx.pixelformat_A = GIMP_PIXELFORMAT_V8;
  special_ctx.pixelformat_B = GIMP_PIXELFORMAT_V8;
  special_ctx.pixelformat_D = GIMP_PIXELFORMAT_V8;
  special_ctx.pixelformat_M = GIMP_PIXELFORMAT_V8;
  special_ctx.A = (unsigned char *) v8A;
  special_ctx.B = (unsigned char *) v8B;
  special_ctx.M = (unsigned char *) v8B;
  special_ctx.D = (unsigned char *) v8D1;
  memset (special_ctx.D, 0, special_ctx.n_pixels * gimp_composite_pixel_bpp[special_ctx.pixelformat_D]);
  memset ((void *) &generic_ctx, 0, sizeof(special_ctx));
  generic_ctx.op = GIMP_COMPOSITE_NORMAL;
  generic_ctx.n_pixels = n_pixels;
  generic_ctx.scale.scale = 2;
  generic_ctx.pixelformat_A = GIMP_PIXELFORMAT_V8;
