int
main (int argc, char *argv[])
{
  int iterations;
  int n_pixels;

  srand(314159);

  putenv("GIMP_COMPOSITE=0x1");

  iterations = 1;
  n_pixels = 262145;

  argv++, argc--;
  while (argc >= 2) {
    if ((strcmp (argv[0], "--iterations") == 0 || strcmp (argv[0], "-i") == 0) && argc > 1) {
      iterations = atoi(argv[1]);
      argc -= 2, argv++; argv++;
    } else if ((strcmp (argv[0], "--n-pixels") == 0 || strcmp (argv[0], "-n") == 0) && argc > 1) {
      n_pixels = atoi (argv[1]);
      argc -= 2, argv++; argv++;
    } else {
      argc--, argv++;
    }
  }

  gimp_composite_generic_install ();

  return (gimp_composite_generic_test(iterations, n_pixels));
}
